import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import CheckoutPage from './CheckoutPage'; // Adjust the path as needed

const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/checkout" component={CheckoutPage} />
            </Switch>
        </Router>
    );
};

export default App;
